GO
SET QUOTED_IDENTIFIER ON
GO

CREATE PROCEDURE [dbo].[InsertJobMediaBulk]
(
    @JobMediaList JobMediaType READONLY,
	@Flag VARCHAr(100),
	@Comments VARCHAR(max),
	@SignedBy VARCHAR(1500),
	@Latitude decimal,
	@Longitude decimal,
	@UserId INT
)
AS
BEGIN
    INSERT INTO JobMedia (JobId, MediaData, UploadedBy, UploadedAt,Flag)
    SELECT JobId, MediaData, UploadedBy, GETDATE(),@Flag
    FROM @JobMediaList


	IF(@Flag='S')
	BEGIN
	update jobs set SignedBy=@SignedBy,TechnicianSummary=@Comments,StatusID=6,
	EndTime=getdate(),
	EndLatitude=@Latitude,
    EndLongitude=@Longitude
	
	where JobId=(
	 SELECT top 1 JobId
    FROM @JobMediaList
	)
	END
END


GO
/****** Object:  StoredProcedure [dbo].[Sp_AddOrRemoveQuotationItems]    Script Date: 28-02-2026 22:06:36 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO


CREATE PROC [dbo].[Sp_AddOrRemoveQuotationItems]
(
@QuotationId INT,
@QuotationItemId INT,
@ItemId INT,
@Quantity decimal,
@Flag CHAR
)
AS BEGIN
IF(@Flag='D')
BEGIN
delete from QuotationItems where QuotationItemId=@QuotationItemId
END
ELSE IF(@Flag='U')
BEGIN
UPDATE QuotationItems set Quantity=@Quantity
where QuotationItemId=@QuotationItemId
END
ELSE IF(@Flag='I')
BEGIN
INSERT INTO QuotationItems (QuotationId,ItemId,ItemDescription,HSNCode,Quantity,UOM,UnitPrice)
SELECT @QuotationId,ItemId,ItemName,HSNCode,@Quantity,UOM,DefaultPrice from  Items 
where ItemId=@ItemId

END


END
GO
/****** Object:  StoredProcedure [dbo].[Sp_ConvertLeadToJob]    Script Date: 28-02-2026 22:06:36 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

CREATE PROCEDURE [dbo].[Sp_ConvertLeadToJob]
    @LeadId INT
AS
BEGIN
    DECLARE @JobId INT

    INSERT INTO Jobs (LeadId, JobStatus, CreatedAt)
    VALUES (@LeadId, 'Assigned', GETDATE())

    SET @JobId = SCOPE_IDENTITY()

    UPDATE Leads
    SET LeadStatus = 'Converted'
    WHERE LeadId = @LeadId

    SELECT @JobId
END
GO
/****** Object:  StoredProcedure [dbo].[Sp_CreateQuotation]    Script Date: 28-02-2026 22:06:36 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO


CREATE PROC [dbo].[Sp_CreateQuotation]
(
@JobId INT,
@DiscountValue  decimal,
@CreatedBy int,
@Status VARCHAR(150),
@Items VARCHAR(max)
)
AS BEGIN
insert into Quotations 
(JobId,QuotationNumber,DiscountType,DiscountValue,CreatedAt,CreatedBy,StatusID,CGST,SGST,IGST)
select top 1 @JobId,'QT-2026-0001','Flat',@DiscountValue,GETDATE(),@CreatedBy,10,CGST,SGST,IGST from [ClientDetails]

DECLARE @QuotationId INT;

SET @QuotationId = SCOPE_IDENTITY();

--DECLARE @data NVARCHAR(MAX) = '1:2,2:2,3:3';
CREATE TABLE #TempData
(
    ItemId INT,
    Quantity INT
);

INSERT INTO #TempData (ItemId, Quantity)
SELECT 
    CAST(LEFT(value, CHARINDEX(':', value) - 1) AS INT),
    CAST(RIGHT(value, LEN(value) - CHARINDEX(':', value)) AS INT)
FROM STRING_SPLIT(@Items, ',');





INSERT INTO QuotationItems (QuotationId,ItemId,ItemDescription,HSNCode,Quantity,UOM,UnitPrice)
SELECT @QuotationId,a.ItemId,ItemName,HSNCode,Quantity,UOM,DefaultPrice FROM #TempData as a inner join Items as b on a.ItemId=b.ItemId


IF(@Status='REJECTED')
BEGIN

UPDATE JOBS SET StatusID=8 where JobId=@JobId
END

END
GO
