GO
SET QUOTED_IDENTIFIER ON
GO
--EXEC [Sp_GetInvoiceData] 2,1
CREATE PROC [dbo].[Sp_GetInvoiceData]
(
@JobId INT,
@IsEstimate BIT
)
AS BEGIN
DECLARE @QuotationId INT;

SELECT  a.JobId,a.QuotationId,
    d.CustomerName,
    d.CustomerGST,
    c.ClientName AS CompanyName,
	c.ClientUPI,
	c.CGST,
	c.SGST,
	c.IGST,
    c.ClientAddress AS CompanyAddress,
    c.PhoneNumber AS Phone,
    c.Email,
    c.GSTIN,
    c.ClientLogo,
    a.QuotationNumber as EstimateNo,
    a.CreatedAt AS EstimateDate

	INTO #Quotations
FROM Quotations AS a
INNER JOIN Jobs AS b ON a.JobId = b.JobId 
INNER JOIN Leads AS ll ON ll.LeadId = b.LeadId
INNER JOIN ClientDetails AS c ON c.ClientId = ll.ClientId
INNER JOIN Customers AS d ON d.CustomerId = ll.CustomerId
INNER JOIN CustomerAddresses AS e ON e.CustomerAddressId = ll.CustomerAddressId
WHERE a.JobId = @JobId;

select * from #Quotations

select ItemDescription as ItemName,HSNCode as HSN,Quantity as Quantity,UOM as Unit,UnitPrice as Price 
from [QuotationItems] where QuotationId in (select QuotationId from #Quotations)
END
GO
