CREATE PROCEDURE [dbo].[Sp_GetLeads]
AS
BEGIN
    SELECT 
        L.LeadId,
        C.CustomerName,
        S.ServiceName,
        L.LeadStatus,
        J.JobId
    FROM Leads L
    INNER JOIN Customers C ON L.CustomerId = C.CustomerId
    INNER JOIN ServiceTypes S ON L.ServiceTypeId = S.ServiceTypeId
    LEFT JOIN Jobs J ON J.LeadId = L.LeadId
    ORDER BY L.LeadDate DESC
END
GO
/****** Object:  StoredProcedure [dbo].[Sp_GetMyJobs]    Script Date: 28-02-2026 22:06:36 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
--EXEC Sp_GetMyJobs 1

CREATE proc [dbo].[Sp_GetMyJobs]
(
@UserID INT
)
AS BEGIn 
SELECT a.JobId,[JobNumber],CustomerName,MobileNo,d.ServiceName,a.ScheduledOn,
e.AddressLine1+','+e.Area+','+e.City+','+e.[State]+','+e.Pincode as [Address],e.[Latitude],e.[Longitude],wf.StatusName JobStatus,
dbo.Fn_GetMyJobsCurrentButtion(wf.StatusName,wf1.StatusName) as CurrentButtion,StartTime,wf.StatusName,wf1.StatusName Status,f.QuotationId,a.EndTime
  FROM [Jobs] as a 
  inner join [Leads] as c on c.LeadId=a.LeadId
  inner join [Customers] as b on c.[CustomerId]=b.[CustomerId]
  inner join [ServiceTypes] as d on d.ServiceTypeId=c.ServiceTypeId
  inner join CustomerAddresses as e on e.CustomerAddressId=c.CustomerAddressId
  INNER JOIN [WorkflowStatus] AS wf on wf.StatusID=a.StatusID
  LEFT JOIN [dbo].[Quotations] as f on f.JobId=a.JobId
  LEFT JOIN [WorkflowStatus] AS wf1 on wf1.StatusID=f.StatusID
END
GO
