CREATE PROCEDURE [dbo].[Sp_SearchCustomerByMobile]
(
    @MobileNo NVARCHAR(20)
)
AS
BEGIN
    SELECT 
        C.CustomerId,
        C.CustomerName,
        C.MobileNo,
        C.WhatsappNo,
        C.EmailId,
        A.CustomerAddressId,
        A.AddressType,
        A.AddressLine1,
        A.Area,
        A.City,
        A.State,
        A.Pincode,
        A.Latitude,
        A.Longitude,
        A.GoogleMapLink,
        A.IsDefault
    FROM Customers C
    LEFT JOIN CustomerAddresses A 
        ON C.CustomerId = A.CustomerId
    WHERE C.MobileNo = @MobileNo
END
GO
