CREATE PROC [dbo].[Sp_UpdateStatus]
(
@UserID INT,
@JobId INT,
@Status VARCHAR(1500),
@Latitude DECIMAL,
@Longitude DECIMAL
)
AS BEGIN

if(@Status='IN PROGRESS')
BEGIN
UPDATE JOBs SET StatusID=5,StartTime=getdate(),StartLatitude=@Latitude,StartLongitude=@Longitude  WHERE JobId=@JobId
END 
ELSE if(@Status='PAYMENT PENDING')
BEGIN
UPDATE JOBs SET StatusID=6,EndTime=getdate(),EndLatitude=@Latitude,EndLongitude=@Longitude  WHERE JobId=@JobId
END 

END
GO
